import Style from "./signUp.module.css";
import React, { useState, useRef } from "react";
import { Link } from "react-router-dom";

const SignUp = () => {
  const [inputId, setInputId] = useState("");
  const [inputName, setInputName] = useState("");
  const [inputPw, setInputPw] = useState("");
  const [inputHeight, setInputHeight] = useState("");
  const [inputWeight, setInputWeight] = useState("");
  const [inputAge, setInputAge] = useState("");
  //유효성 검사

  //Focus용
  const IdInput = useRef();
  const NameInput = useRef();
  const PwInput = useRef();
  const HeightInput = useRef();
  const WeightInput = useRef();
  const AgeInput = useRef();

  const submitHandler = () => {
    if (inputId.length < 5) {
      IdInput.current.focus();
      return;
    }
    if (inputName.length < 2) {
      NameInput.current.focus();
      return;
    }
    if (inputPw.length < 5) {
      PwInput.current.focus();
      return;
    }
    if (inputHeight.length < 3) {
      HeightInput.current.focus();
      return;
    }
    if (inputWeight.length < 2) {
      WeightInput.current.focus();
      return;
    }
    if (inputAge.length < 1) {
      AgeInput.current.focus();
    }
  };

  //input data의 변화 있을 때마다 value값 변경하여 useState
  const handleInputId = (e) => {
    setInputId(e.target.value);
  };

  const handleInputPw = (e) => {
    setInputPw(e.target.value);
  };
  const handleInputName = (e) => {
    setInputName(e.target.value);
  };
  const handleInputHeight = (e) => {
    setInputHeight(e.target.value);
  };
  const handleInputWeight = (e) => {
    setInputWeight(e.target.value);
  };
  const handleInputAge = (e) => {
    setInputAge(e.target.value);
  };

  return (
    <div className={Style.field}>
      <form>
        <h1>Sign Up</h1>
        {/* E-mail */}
        <div>
          <input
            className="basic"
            ref={IdInput}
            type="email"
            name="input_id"
            value={inputId}
            placeholder="Example@mail.com"
            onChange={handleInputId}
          />
        </div>
        <input
          className="basic"
          ref={NameInput}
          type="text"
          name="name"
          value={inputName}
          placeholder="Name"
          onChange={handleInputName}
        />
        <br />
        {/* Password */}
        <input
          className="basic"
          ref={PwInput}
          type="text"
          name="input_pw"
          value={inputPw}
          placeholder="PassWord"
          onChange={handleInputPw}
        />
        <br />
        {/* Password Check */}
        <input
          className="basic"
          type="text"
          name="input_pw_check"
          placeholder="PassWord Check"
        />
        <br />
        {/* Gender Check */}
        <input
          type="raido"
          name="gender"
          value="male"
          // Checkbox로 Focus주는 법 모르겠음
        />
        <label htmlFor="cb1">Male</label>
        <input
          id="female"
          type="radio"
          name="gender"
        />
        <label htmlFor="cb2">Female</label>
        <input
          className="age"
          ref={AgeInput}
          onKeyPress={(event) => {
            if (!/[0-9]/.test(event.key)) {
              event.preventDefault();
            }
          }}
          placeholder="Age"
          onChange={handleInputAge}
        />
        <br />
        <input
          className="height"
          ref={HeightInput}
          onKeyPress={(event) => {
            if (!/[0-9]/.test(event.key)) {
              event.preventDefault();
            }
          }}
          placeholder="Height"
          onChange={handleInputHeight}
        />
        <input
          className="weight"
          ref={WeightInput}
          onKeyPress={(event) => {
            if (!/[0-9]/.test(event.key)) {
              event.preventDefault();
            }
          }}
          placeholder="Weight"
          onChange={handleInputWeight}
        />
        {/* Return & Submit  */}
        <Link to="/login">
          <button className="return" type="button">
            Return
          </button>
        </Link>
        <button className="submit" type="button" onClick={submitHandler}>
          Submit
        </button>
      </form>
    </div>
  );
};
export default SignUp;
